function SeatElement({seat, handleSeatChange}) {
    const handleSeatClick = (seat_index) =>
    {
      handleSeatChange(seat_index);  
      console.log("View changed to seat: ", seat_index);
    };

    return (
        <>
        {seat.isOccupied ? (
            <button className="seatElementOccupied" onClick={handleSeatClick(seat.number-1)}>
                <p className="seatFont">{seat.number}</p>
            </button>
        ) : (
            <button className="seatElementFree" onClick={handleSeatClick(seat.number-1)}>
                <b><p className="seatFont">{seat.number}</p></b>
            </button>
        )}
        </>
    );
}

export default SeatElement;
